const AboutMe = (props) => {
    return(
        <div>
            <h1>My name is {props.name}.</h1>
            <p> I grew up in {props.origins}.</p>
            <ul> I've been to {props.travel}</ul>
        </div>
    )    
};

export default AboutMe;
